function register(e){$.ajax({type:e.attr("method"),url:e.attr("action"),data:e.serialize(),cache:!1,dataType:"json",contentType:"application/json; charset=utf-8",error:function(e){console.log("Could not connect to the registration server. Please try again later."),console.log(e)},success:function(e){console.log(e.msg),"success"!=e.result?($("#errorSubscribe").html(e.msg),$("#errorSubscribe").slideDown(e.msg)):($("#successSubscribe").html(e.msg),$("#successSubscribe").slideDown(e.msg))}})}$(document).ready(function(){var e=$("form");$("#successSubscribe").hide(),$("#errorSubscribe").hide(),e.length>0&&$("#btnSubmit").bind("click",function(s){s&&s.preventDefault(),$("#successSubscribe").hide(),$("#errorSubscribe").hide(),register(e)})});